export function getCandidates(districtId: string, constituency: number | string): CandidateData[] {
  const key = `${districtId.toLowerCase()}-${constituency}`;
  return CANDIDATES[key] || [];
}

export function getDistrictCandidates(districtId: string): Record<number, CandidateData[]> {
  const result: Record<number, CandidateData[]> = {};
  const prefix = `${districtId.toLowerCase()}-`;
  Object.keys(CANDIDATES).forEach(key => {
    if (key.startsWith(prefix)) {
      const constNum = parseInt(key.replace(prefix, ""), 10);
      if (!isNaN(constNum)) result[constNum] = CANDIDATES[key];
    }
  });
  return result;
}

export function getConstituencies(districtId: string): number[] {
  const candidates = getDistrictCandidates(districtId);
  return Object.keys(candidates).map(Number).sort((a, b) => a - b);
}